import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchData } from "../../utils/utils";
import { movieMenu } from "../../slices/AppSlice";

const MovieMenu = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    async function fetchDataFunction() {
      const res = await fetchData("movie/now_playing");
      dispatch(movieMenu(res));
    }
    fetchDataFunction();
  }, []);
  const nowPlayingMovie = useSelector((state) => state.app.nowPlaying.data);
  return (
    <div>
      <ul>
        <li>Popular</li>
        <li>nowPlayingMovie</li>
        <li>UpComing</li>
        <li>Top Rated</li>
      </ul>
    </div>
  );
};

export default MovieMenu;
